/*!

* Copyright 2019 Symto Inc.

*/
import React from 'react';
import ReactDOM from 'react-dom';
import { BrowserRouter, Route, Switch, Redirect } from 'react-router-dom';

import './assets/css/nucleo-icons.css';
import './assets/scss/blk-design-system-react.scss?v=1.0.0';
import './assets/demo/demo.css';

import LandingPage from 'views/LandingPage.jsx';
import RegisterPage from 'views/RegisterPage.jsx';
import ProfilePage from 'views/ProfilePage.jsx';
import LoginPage from './views/LoginPage';
import ChatPage from './views/ChatPage';
import AccountSettings from './views/AccountSettings';
import CheckoutPage from './views/CheckoutPage';
import InvoicePage from './views/InvoicePage';
import ResetPage from './views/ResetPage';
import Error500 from './views/Error500';
import Error400 from './views/Error404';
import ProductPage from './views/ProductPage';
import Ecommerce from './views/Ecommerce';
import Pricing from './views/Pricing';
import ContactUs from './views/ContactUs';
import BlogPosts from './views/BlogPosts';
import BlogPost from './views/BlogPost';
import AboutUs from './views/AboutUs';
import Sections from './views/Sections';

ReactDOM.render(
	<BrowserRouter>
		<Switch>
			<Route
				path='/home'
				render={(props) => <LandingPage {...props} />}
			/>
			<Route
				path='/register'
				render={(props) => <RegisterPage {...props} />}
			/>
			<Route path='/login' render={(props) => <LoginPage {...props} />} />
			<Route
				path='/profile'
				render={(props) => <ProfilePage {...props} />}
			/>
			<Route path='/chat' render={(props) => <ChatPage {...props} />} />
			<Route
				path='/settings'
				render={(props) => <AccountSettings {...props} />}
			/>
			<Route
				path='/sections'
				render={(props) => <Sections {...props} />}
			/>
			<Route
				path='/about-us'
				render={(props) => <AboutUs {...props} />}
			/>
			<Route
				path='/blog-post'
				render={(props) => <BlogPost {...props} />}
			/>
			<Route
				path='/blog-posts'
				render={(props) => <BlogPosts {...props} />}
			/>
			<Route
				path='/contact-us'
				render={(props) => <ContactUs {...props} />}
			/>
			<Route path='/pricing' render={(props) => <Pricing {...props} />} />
			<Route
				path='/ecommerce'
				render={(props) => <Ecommerce {...props} />}
			/>
			<Route
				path='/product-page'
				render={(props) => <ProductPage {...props} />}
			/>
			<Route
				path='/404-error'
				render={(props) => <Error400 {...props} />}
			/>
			<Route
				path='/500-error'
				render={(props) => <Error500 {...props} />}
			/>
			<Route
				path='/reset-page'
				render={(props) => <ResetPage {...props} />}
			/>
			<Route
				path='/invoice-page'
				render={(props) => <InvoicePage {...props} />}
			/>
			<Route
				path='/checkout-page'
				render={(props) => <CheckoutPage {...props} />}
			/>
			<Redirect from='/' to='/home' />
		</Switch>
	</BrowserRouter>,
	document.getElementById('root')
);
